import { TT_Atomics } from "src/constants/index";
import { isString } from "src/runtime/index";
/**
 * **isAtomicToken**`(val)`
 *
 * Type guard which validates whether the value passed in is a
 * valid `AtomicToken`.
 */
export const isAtomicToken = (val) => {
    return isString(val) &&
        TT_Atomics.some(v => val === `<<${v}>>`);
};
